"Photo by @GerdLudwig, shot #onassignment for @natgeo. The Salton Sea is endangered by increased salinity. A victim of geography and hard-ball politics, The Salton Sea is California's largest, most troubled lake. It lies 227 feet below sea level with no outlet and very thirsty neighbors, including a billion dollar farm economy in the bone-dry Imperial Valley, 124 golf courses, and salt laden wetlands hosting a menagerie of wildlife in growing crisis. The current drought in California is not helping.

Ive just announced an upcoming documentary photography workshop at the Salton Sea, March 29 - April 3, 2016. Information here: http://www.gerdludwig.com/2015/11/the-art-of-storytelling-the-salton-sea-3/

